uniform float iTime;
uniform vec2 iResolution;
uniform vec4 iMouse;
uniform sampler2D iChannel0;

// Parameters via JSON:
uniform float u_speed;
uniform float u_fov;
uniform float u_camera_dist;
uniform float u_morph;

out vec4 fragColor;

// --- UTILS ---
mat2 rot(float a) {
    float s = sin(a), c = cos(a);
    return mat2(c, -s, s, c);
}

float sdBox(vec3 p, vec3 b) {
    vec3 q = abs(p) - b;
    return length(max(q, 0.0)) + min(max(q.x, max(q.y, q.z)), 0.0);
}

// Cheap noise for volumetric effects
float hash(vec3 p) {
    p = fract(p * 0.3183099 + 0.1);
    p *= 17.0;
    return fract(p.x * p.y * p.z * (p.x + p.y + p.z));
}

// --- WORLD LOGIC ---

// The "Universe Path" for the parallel rail system
vec2 getPath(float z) {
    return vec2(sin(z * 0.2) * 2.5, cos(z * 0.15) * 2.0);
}

// Distance Function
float map(vec3 p) {
    // 1. Position relative to path
    p.xy -= getPath(p.z);

    // Create a repeating spatial lattice
    vec3 p_grid = p;
    float interval = 8.0;
    float id = floor(p_grid.z / interval);
    p_grid.z = mod(p_grid.z, interval) - interval * 0.5;

    // Rotate individual segments for surreal feel
    p_grid.xy *= rot(iTime * 0.2 + id);
    p_grid.xz *= rot(iTime * 0.1);

    // Fractal Morphing Object
    float d = 1e10;
    vec3 q = p_grid;
    float s = 1.0;

    // Iterative folding (Sierpinski/Menger hybrid influence)
    for(int i = 0; i < 4; i++) {
        q = abs(q) - 0.5 * u_morph;
        q.xy *= rot(0.5);
        q.yz *= rot(0.3);
        s *= 1.4;
        q *= 1.4;
    }

    float shape1 = sdBox(q, vec3(1.0)) / s;
    float shape2 = length(q) / s - 0.5;

    d = mix(shape1, shape2, sin(iTime * 0.5) * 0.5 + 0.5);

    // Add a central "Core" strand
    float core = length(p.xy) - 0.2;
    d = min(d, core);

    return d * 0.8; // Step scaling for safety
}

// Simple Normal calculation
vec3 getNormal(vec3 p) {
    vec2 e = vec2(0.001, 0.0);
    return normalize(vec3(
        map(p + e.xyy) - map(p - e.xyy),
        map(p + e.yxy) - map(p - e.yxy),
        map(p + e.yyx) - map(p - e.yyx)
    ));
}

void main() {
    vec2 uv = (gl_FragCoord.xy - 0.5 * iResolution.xy) / iResolution.y;

    // Speed and Pathing
    float t = iTime * u_speed;

    // 1. Path Position (The center of the world)
    vec3 pathPos = vec3(0.0, 0.0, t);
    pathPos.xy += getPath(pathPos.z);

    // 2. PARALLEL RAIL SYSTEM
    // The camera orbits the path while moving along it
    float angle = t * 0.1;
    vec2 railVec = vec2(cos(angle), sin(angle)) * u_camera_dist;

    vec3 ro = pathPos;
    ro.xy += railVec; 

    // 3. TARGET (Look ahead, slightly inward to keep geometry in view)
    vec3 ta = vec3(0.0, 0.0, t + 10.0);
    ta.xy += getPath(ta.z) + railVec * 0.5; 

    // Camera Setup
    vec3 fwd = normalize(ta - ro);
    vec3 right = normalize(cross(vec3(0.0, 1.0, 0.0), fwd));
    vec3 up = cross(fwd, right);
    vec3 rd = normalize(fwd * u_fov + uv.x * right + uv.y * up);

    // Raymarching Loop
    float d = 0.0, t_dist = 0.0;
    float glow = 0.0;
    vec3 p;

    for(int i = 0; i < 100; i++) {
        p = ro + rd * t_dist;
        d = map(p);
        if(d < 0.001 || t_dist > 60.0) break;
        t_dist += d;
        // Accumulate glow based on proximity
        glow += exp(-d * 4.0);
    }

    // Coloring
    vec3 col = vec3(0.0);

    if(t_dist < 60.0) {
        vec3 n = getNormal(p);
        vec3 lightDir = normalize(vec3(1.0, 2.0, -1.0));
        float diff = max(dot(n, lightDir), 0.0);
        float fresnel = pow(1.0 + dot(rd, n), 4.0);

        // Base color driven by depth and normals
        vec3 baseCol = 0.5 + 0.5 * cos(vec3(0.0, 1.0, 2.0) + p.z * 0.1);
        col = baseCol * diff;
        col += fresnel * vec3(0.5, 0.8, 1.0); // Icy rim light

        // Fog/Depth attenuation
        col = mix(col, vec3(0.02, 0.01, 0.05), 1.0 - exp(-0.02 * t_dist));
    } else {
        // Background / Stars
        col = vec3(0.01, 0.01, 0.03);
        float stars = pow(hash(rd * 500.0), 100.0);
        col += stars;
    }

    // Post-processing: Add Procedural Glow
    col += glow * 0.02 * vec3(0.6, 0.2, 0.9);

    // Cinematic Vignette
    col *= 1.0 - length(uv) * 0.5;

    // Tone mapping
    col = smoothstep(0.0, 1.0, col);
    col = pow(col, vec3(0.4545)); // Gamma correction

    fragColor = vec4(col, 1.0);
}
